import React from 'react';
import '../../styles/App.css';
import polaroid from '../../images/polaroid-frame.png'
function Bio() {
    return (

      <div>
          <article class="article">
          <h2 id="Bio">Bio</h2>
          <img alt="" id="polaroid" src={polaroid}></img>


      </article>
      </div>

    )
}




export default Bio;
